Connection::ConnectionTypeEnum Connection::toConnectionTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("PRIMARY")) {
        return ConnectionTypeEnum::PRIMARY;
    }
    
    if (value == utility::conversions::to_string_t("SECONDARY")) {
        return ConnectionTypeEnum::SECONDARY;
    }
    
    if (value == utility::conversions::to_string_t("DEPENDENT")) {
        return ConnectionTypeEnum::DEPENDENT;
    }
    
    if (value == utility::conversions::to_string_t("ACQUAINTANCE")) {
        return ConnectionTypeEnum::ACQUAINTANCE;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ConnectionTypeEnum");
}


const utility::string_t Connection::fromConnectionTypeEnum(const ConnectionTypeEnum value) const
{
    switch(value)
    {
        
        case ConnectionTypeEnum::PRIMARY: return utility::conversions::to_string_t("PRIMARY");
        
        case ConnectionTypeEnum::SECONDARY: return utility::conversions::to_string_t("SECONDARY");
        
        case ConnectionTypeEnum::DEPENDENT: return utility::conversions::to_string_t("DEPENDENT");
        
        case ConnectionTypeEnum::ACQUAINTANCE: return utility::conversions::to_string_t("ACQUAINTANCE");
        
    }
}


